// client-side js, loaded by index.html
// run by the browser each time the page is loaded

console.log("hello world :o");
var keyword_extractor = require("keyword-extractor");

const SerpApi = require('google-search-results-nodejs')
const search = new SerpApi.GoogleSearch("Your Private Key")
search.json({
 q: "Coffee", 
 location: "Austin, TX"
}, (result) => {
  console.log(result)
})

var wordsSeen = new Set()

var SpeechRecognition = SpeechRecognition || webkitSpeechRecognition

var recognition = new SpeechRecognition();

recognition.onresult = function(event) {
  var text = event.results[0][0].transcript;
  console.log('Confidence: ' + event.results[0][0].confidence);
  console.log(text);
  display(text)
  var keywords = getKeyWords(text)
  
  keywords.forEach(s=> {
     console.log(s)
     if(!wordsSeen.has(s)) {                 
       appendNewDream(s);
       wordsSeen.add(s);
    }
  }
  )
}


recognition.lang =  'en-US'; // zh for chinese
recognition.interimResults = false;
//recognition.start();

function onStart() {
  recognition.start();
}

function onStop() {
  recognition.stop();
}

const startButton = document.getElementById("START");
startButton.addEventListener("click", event=> onStart());

const stopButton = document.getElementById("STOP");
stopButton.addEventListener("click", event=> onStop());

const displayArea = document.getElementById("DISPLAY")

function display(sentence)
{
  displayArea.innerHTML = sentence
}

function getKeyWords(sentence) {
  var extraction_result = keyword_extractor.extract(sentence,{
                                                                  language:"english",
                                                                  remove_digits: true,
                                                                  return_changed_case:true,
                                                                  remove_duplicates: true

                                                               });
  return extraction_result;
  
}

// define variables that reference elements on our page
const dreamsList = document.getElementById("dreams");
const dreamsForm = document.querySelector("form");
const picture = document.getElementById("PICTURE");

// a helper function that creates a list item for a given dream
function appendNewDream(dream) {
  const newListItem = document.createElement("li");
  newListItem.innerText = dream;
  dreamsList.appendChild(newListItem);
}

function showPicture(url) {
  var img = document.createElement("img");
  img.src = url;
  img.width = 200;
  picture.appendChild(img);
}

display("Great");

showPicture(
  "https://i.pinimg.com/564x/46/da/e5/46dae512e375bee2664a025507da8795.jpg"
);

// fetch the initial list of dreams
fetch("/dreams")
  .then(response => response.json()) // parse the JSON from the server
  .then(dreams => {
    // remove the loading text
    dreamsList.firstElementChild.remove();
  
    // iterate through every dream and add it to our page
    dreams.forEach(appendNewDream);
  
    // listen for the form to be submitted and add a new dream when it is
    dreamsForm.addEventListener("submit", event => {
      // stop our form submission from refreshing the page
      event.preventDefault();

      // get dream value and add it to the list
      let newDream = dreamsForm.elements.dream.value;
      dreams.push(newDream);
      appendNewDream(newDream);

      // reset form
      dreamsForm.reset();
      dreamsForm.elements.dream.focus();
    });
  });

